import React from 'react';
import "../css/BarChart.css";

const data = [
  { label: 'HTML', percentage: 10 },
  { label: 'CSS', percentage: 20 },
  { label: 'ReactJS', percentage: 30 },
  { label: 'Github', percentage: 40 },
];

const BarChart = () => {
  return (
    <div className="bar-chart">
      {data.map(item => (
        <div key={item.label} className="bar">
          <div className="bar-fill" style={{ width: `${item.percentage}%` }}>
            {item.label}
          </div>
        </div>
      ))}
    </div>
  );
};

export default BarChart;
